import{_ as n,W as a,X as s,a0 as t}from"./framework-16b96b76.js";const e="/assets/1699851737223-6fa130c1.png",p={},i=t('<h1 id="_1-基础概念" tabindex="-1"><a class="header-anchor" href="#_1-基础概念" aria-hidden="true">#</a> 1. 基础概念</h1><p>类、对象、集合、枚举、注解、异常、泛型、反射、lambda、JUC、序列化</p><h2 id="类-、-实例-instance-、-对象-object-、实例化" tabindex="-1"><a class="header-anchor" href="#类-、-实例-instance-、-对象-object-、实例化" aria-hidden="true">#</a> 类 、 实例（instance） 、 对象（object） 、实例化</h2><p>面向对象的程序设计中，</p><ul><li>用类创建对象的过程称为<code>实例化</code>；</li><li>类实例化后的一个<code>对象</code>叫做<code>类</code>的一个<code>实例</code>；</li><li><code>对象</code> = <code>实例</code></li></ul><p>如 Date today=new Date()， today 变量是由 Date 类 new 出来的，这个 new 的过程称为：类的实例化过程， today 变量成为 Date 类的一个实例。</p><p>关系由强到弱可以划分为： 泛化 = 实现 &gt; 组合 &gt; 聚合 &gt; 关联 &gt; 依赖 。这几种关系大概可以分为： 横向关系和纵向关系。也可以划分为实体之间的关系和类之间的关系。纵向关系包括泛化和实现，这两种关系就也称为类之间的关系，这里我们不做讨论。我们只讨论实体之间的关系，或者说我们只讨论横向关系。</p><ul><li>依赖（Dependency）：语义“a uses b”，a 依赖于 b，但不持有 b 的引用。</li><li>关联（Association）：语义“a has b”，a 拥有 b 的引用，但 a 和 b 无从属关系，二者是一种松散的关联关系，可以随时解除或建立。</li><li>聚合（Aggregation）：语义“a owns b”，a 拥有 b 的引用，且有从属关系，二者的耦合比关联更强，但 a 并不负责 b 的生命周期。</li><li>组合（Composition）：语义“b is a part of a”，a 不仅拥有 b 的引用，还应该全权负责 b 的整个生命周期，在程序中 b 通常是 a 的内部实现细节，不暴露给外部。</li></ul><p>我们注意这四种关系中有一个关键的概念“对象生命周期”，在建模时辨别清楚对象生命周期就不难选择采用 DI 还是创建对象。DI 意味着使用者不负责依赖对象的生命周期，创建对象则相反。对应到上面的 4 种横向关系，我们一般可以这样处理：第 1 种依赖关系不需要 DI 也不需要创建对象；第 2，3 种关联和聚合关系适合采用 DI 方式，最后一种组合关系适合采用创建对象方式。</p><p>类与类之间由强到弱关系是: 泛化 = 实现 &gt; 组合 &gt; 聚合 &gt; 关联 &gt; 依赖，其中关联，聚合，组合，这三种都是关联关系，并且代码表现都是整体的某个部分，即成员变量。他们只是有强弱关系区分。</p><h2 id="变量" tabindex="-1"><a class="header-anchor" href="#变量" aria-hidden="true">#</a> 变量</h2><ol><li>类变量 <ul><li>也叫静态变量，是一种比较特殊的实例变量，用 static 关键字修饰；</li><li>一个类的静态变量，所有由这类生成的对象都共用这个类变量，类装载时就分配存储空间；</li><li>一个对象修改了变量，则所有对象中这个变量的值都会发生改变；</li></ul></li><li>实例变量 <ul><li>也叫对象变量、成员变量；</li><li>从属于类，由类生成对象时，才分配存储空间，各对象间的实例变量互不干扰，能通过对象的引用来访问实例变量；</li><li>但在 Java 多线程中，实例变量是多个线程共享资源，要注意同步访问时可能出现的问题；</li></ul></li><li>局部变量 <ul><li>方法中或者某局部块中声明定义的变量或方法的参数被称为局部变量，</li><li>他们只存在于创建他们的 block 里（{}之间）无法在 block 外进行任何操作，如读取、赋值；</li><li>在 Java 多线程中，每个线程都复制一份局部变量，可防止某些同步问题发生；</li><li><img src="'+e+`" alt="image.png" tabindex="0" loading="lazy"><figcaption>image.png</figcaption></li></ul></li><li>全局变量： 包括类变量和成员变量。</li><li>静态变量： 用 static 关键字修饰的变量。 <ul><li>用法上，static 是 Java 的保留关键字，主要是用来限定被修饰对象的使用范围的；</li><li>可以被用来修饰变量和方法，被修饰的变量成为类变量或静态变量，被修饰的方法被称为类方法或静态方法；区别于成员变量和成员方法；</li><li>被 static 修饰的变量和方法可以被类直接使用，而成员变量和成员方法只能被类生成的对象来调用；</li><li>成员变量和成员方法不能使用由 static 修饰的变量和方法，即成员变量和成员方法不能调用类变量和类方法；</li><li>从 JVM 角度讲，static 修饰的代码编译后就确定下来了，而成员变量和成员方法是在运行期动态确定的，所以</li></ul></li></ol><h2 id="final-作用" tabindex="-1"><a class="header-anchor" href="#final-作用" aria-hidden="true">#</a> final 作用</h2><ol><li>修饰类 <ol><li>表明这个类不能被继承；</li><li>类中的所有成员方法都会被隐式地指定为 final 方法；</li><li>类中属性的访问权限可以随意设置；</li></ol></li><li>修饰方法 <ol><li>使用 final 方法的原因有两个。第一个原因是把方法锁定，以防任何继承类修改它的含义；第二个原因是效率。在早期的 Java 实现版本中，会将 final 方法转为内嵌调用。但是如果方法过于庞大，可能看不到内嵌调用带来的任何性能提升。在最近的 Java 版本中，不需要使用 final 方法进行这些优化了。因此，如果只有在想明确禁止 该方法在子类中被覆盖的情况下才将方法设置为 final 的。</li><li>类的 private 方法会隐式地被指定为 final 方法。</li></ol></li><li>修饰变量 <ol><li>如果是基本数据类型的变量，则其数值一旦在初始化之后便不能更改；如果是引用类型的变量，则在对其初始化之后便不能再让其指向另一个对象。</li><li>当用 final 作用于类的成员变量时，成员变量（注意是类的成员变量，局部变量只需要保证在使用之前被初始化赋值即可）必须在定义时或者构造器中进行初始化赋值，而且 final 变量一旦被初始化赋值之后，就不能再被赋值了。</li><li>static 作用于成员变量用来表示只保存一份副本，而 final 的作用是用来保证变量不可变</li></ol></li></ol><h2 id="类的加载机制" tabindex="-1"><a class="header-anchor" href="#类的加载机制" aria-hidden="true">#</a> 类的加载机制</h2><ol><li>类中所有属性的默认值（一举而成）</li><li>父类静态属性初始化，静态块，静态方法的声明（按出现顺序执行）</li><li>子类静态属性初始化，静态块，静态方法的声明 （按出现顺序执行）</li><li>调用父类的构造方法，首先父类的非静态成员初始化，构造块，普通方法的声明（按出现顺序执行）然后父类构造方法。</li><li>调用子类的构造方法，首先子类的非静态成员初始化，构造块，普通方法的声明（按出现顺序执行）然后子类构造方法。</li></ol><p>内部静态类不会自动初始化，只有调用静态内部类的方法，静态域，或者构造方法的时候才会加载静态内部类。</p><p>java 遵循“使用时，才加载”的原则。 注意：类的加载过程只发生一次。</p><ol><li>对于不含静态方法的非抽象类而言，如果你只是创建了一个类的空引用，并没有执行 new 操作，该类是不会被加载的。也就是说，一个不含静态方法的非抽象类要被加载的话，肯定是在第一次实例化对象时，才会发生类的加载，同时生成实例化对象。但是之后再实例化对象，类的加载过程不会再发生，类的加载过程只发生一次。</li><li>对于含静态方法的非抽象类而言，第一次执行 new 操作进行实例化或者调用类方法（即该类的静态方法）时，该类才会被加载的。</li><li>对于不含静态方法的抽象类而言，只有继承了该类的非抽象子类要被加载时，该不含静态方法的抽象类才会被加载。且抽象父类先加载，非抽象子类后加载。至于非抽象子类什么时候会被加载，见 1、2 两点。</li><li>对于含静态方法的抽象类而言，继承了该类的非抽象子类要被加载时或者调用该含静态方法的抽象类的类方法（即该类的静态方法）时，该含静态方法的抽象类才会被加载。</li><li>接口和不含静态方法的抽象类情况类似，都是只有继承了该接口的非抽象子类要被加载时，该接口才会被加载。应该是父接口先加载，非抽象子类后加载。</li></ol><p>上面列了五段话说的绕来绕去的（感觉基础不好的真的会被绕晕，我自己都觉得绕），其实就是为了说明开头的那一段话“java 遵循“使用时，才加载”的原则”。通俗点说就是只有用得着某个类或接口的时候，这个类或接口才会被加载，否则就是哪凉快哪待着去。</p><h2 id="环境常用名词" tabindex="-1"><a class="header-anchor" href="#环境常用名词" aria-hidden="true">#</a> 环境常用名词</h2><ul><li>DEV(Development environment)</li><li>FAT(Feature Acceptance Test environment)</li><li>UAT(User Acceptance Test environment)</li><li>PRO(Production environment)</li></ul><h2 id="_1-导引" tabindex="-1"><a class="header-anchor" href="#_1-导引" aria-hidden="true">#</a> 1. 导引</h2><p>我们知道，Java 中 int 变量存在于 jvm 的静态区中，在系统之中它的存在形式很简单，就是一个简单的内存块，里面放了一个具体的数字，而 Integer 则是一个具体的对象，里面不光有具体的数字，还有一些具体的操作方法。早期的 Java 版本中，要想对 int 的数据进行对象化操作时，就必须要先把 int 转化为 Integer 对象才能够进行操作。例如：在 Java1.5 中，集合（Collections）不能直接放入 int 类型的数据，因为集合中要求存放的必须是对象。所以，为了节省由原始类型转化为对象类型的人工成本，也为了迎合 Java 中一切都是对象的思想，Java 后续的版本中就引入了自动拆箱和自动装箱的机制。</p><h2 id="_2-概念" tabindex="-1"><a class="header-anchor" href="#_2-概念" aria-hidden="true">#</a> 2. 概念</h2><h3 id="_2-1-基本数据类型和封装数据类型" tabindex="-1"><a class="header-anchor" href="#_2-1-基本数据类型和封装数据类型" aria-hidden="true">#</a> 2.1 基本数据类型和封装数据类型</h3><p>基本数据类型主要有 8 种，他们分别是：</p><table><thead><tr><th>基本数据类型(primitive)</th><th>byte</th><th>short</th><th>int</th><th>long</th><th>float</th><th>double</th><th>char</th><th>boolean</th></tr></thead><tbody><tr><td>占用内存大小</td><td>1 字节</td><td>2 字节</td><td>4 字节</td><td>8 字节</td><td>4 字节</td><td>8 字节</td><td>1 字节</td><td>未知</td></tr><tr><td>默认值</td><td>(byte)0</td><td>(short)0</td><td>0</td><td>0L</td><td>0.0f</td><td>0.0d</td><td>\\u000</td><td>false</td></tr><tr><td>封装数据类型(wrapper)</td><td>Byte</td><td>Short</td><td>Integer</td><td>Long</td><td>Float</td><td>Double</td><td>Character</td><td>Boolean</td></tr></tbody></table><p>二者之间的区别：</p><table><thead><tr><th>基本数据类型</th><th>封装数据类型</th></tr></thead><tbody><tr><td>1. 基本类型 2. 是面向机器底层的数据结构，不需要实例化 3. 在内存中就是一个简单的变量，没有具体的操作方法</td><td>1. 引用类型 2. 是 Java 对象，<strong>可能</strong>需要进行实例化 3. 有具体的操作方法</td></tr></tbody></table><h3 id="_2-2-拆箱和装箱" tabindex="-1"><a class="header-anchor" href="#_2-2-拆箱和装箱" aria-hidden="true">#</a> 2.2 拆箱和装箱</h3><p>装箱就是将基本数据类型转化为封装数据类型的过程，其主要使用了 valueOf()函数将对象的值转化为封装类型的对象；同时，拆箱过程中，就使用 intValue()、doubleValue()等函数，将对象的值转化为基本数据类型的值。</p><hr><h2 id="_3-1-适用场景" tabindex="-1"><a class="header-anchor" href="#_3-1-适用场景" aria-hidden="true">#</a> 3.1 适用场景</h2><p>在 Java1.5 之前都需要手动的进行基本数据类型到封装类型之间的转化，Java1.5 之后就可以实现自动的拆箱和装箱操作了。</p><h3 id="_3-1-1-赋值" tabindex="-1"><a class="header-anchor" href="#_3-1-1-赋值" aria-hidden="true">#</a> 3.1.1 赋值</h3><p>自动拆箱和自动装箱的一个应用场景就是赋值操作。</p><p>如下面代码：</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code><span class="token comment">//before autoboxing</span>
<span class="token class-name">Integer</span> iObject <span class="token operator">=</span> <span class="token class-name">Integer</span><span class="token punctuation">.</span><span class="token function">valueOf</span><span class="token punctuation">(</span><span class="token number">3</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token class-name">Int</span> iPrimitive <span class="token operator">=</span> iObject<span class="token punctuation">.</span><span class="token function">intValue</span><span class="token punctuation">(</span><span class="token punctuation">)</span>

<span class="token comment">//after java5</span>
<span class="token class-name">Integer</span> iObject <span class="token operator">=</span> <span class="token number">3</span><span class="token punctuation">;</span> <span class="token comment">//autobxing - primitive to wrapper conversion</span>
<span class="token keyword">int</span> iPrimitive <span class="token operator">=</span> iObject<span class="token punctuation">;</span> <span class="token comment">//unboxing - object to primitive conversion</span>

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>Java 编译器帮我们自动完成装箱和拆箱操作。</p><h3 id="_3-1-2-方法调用" tabindex="-1"><a class="header-anchor" href="#_3-1-2-方法调用" aria-hidden="true">#</a> 3.1.2 方法调用</h3><p>另外一个应用场景就是方法调用，在方法调用的过程中，方法会根据具体的参数类型来进行拆箱和装箱操作。如下所示：</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code><span class="token keyword">public</span> <span class="token keyword">static</span> <span class="token class-name">Integer</span> <span class="token function">show</span><span class="token punctuation">(</span><span class="token class-name">Integer</span> iParam<span class="token punctuation">)</span><span class="token punctuation">{</span>
   <span class="token class-name">System</span><span class="token punctuation">.</span>out<span class="token punctuation">.</span><span class="token function">println</span><span class="token punctuation">(</span><span class="token string">&quot;autoboxing example - method invocation i: &quot;</span> <span class="token operator">+</span> iParam<span class="token punctuation">)</span><span class="token punctuation">;</span>
   <span class="token keyword">return</span> iParam<span class="token punctuation">;</span>
<span class="token punctuation">}</span>

<span class="token comment">//autoboxing and unboxing in method invocation</span>
<span class="token function">show</span><span class="token punctuation">(</span><span class="token number">3</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">//autoboxing</span>
<span class="token keyword">int</span> result <span class="token operator">=</span> <span class="token function">show</span><span class="token punctuation">(</span><span class="token number">3</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">//unboxing because return type of method is Integer</span>

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><h2 id="_3-2-不适用场景" tabindex="-1"><a class="header-anchor" href="#_3-2-不适用场景" aria-hidden="true">#</a> 3.2 不适用场景</h2><h3 id="_3-2-1-重载" tabindex="-1"><a class="header-anchor" href="#_3-2-1-重载" aria-hidden="true">#</a> 3.2.1 重载</h3><p>什么情况下不适用，就是重载场景中。先看一个场景：</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code><span class="token keyword">public</span> <span class="token keyword">void</span> <span class="token function">test</span><span class="token punctuation">(</span><span class="token keyword">int</span> num<span class="token punctuation">)</span><span class="token punctuation">{</span>
    <span class="token class-name">System</span><span class="token punctuation">.</span>out<span class="token punctuation">.</span><span class="token function">println</span><span class="token punctuation">(</span><span class="token string">&quot;method with primitive argument&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

<span class="token punctuation">}</span>

<span class="token keyword">public</span> <span class="token keyword">void</span> <span class="token function">test</span><span class="token punctuation">(</span><span class="token class-name">Integer</span> num<span class="token punctuation">)</span><span class="token punctuation">{</span>
    <span class="token class-name">System</span><span class="token punctuation">.</span>out<span class="token punctuation">.</span><span class="token function">println</span><span class="token punctuation">(</span><span class="token string">&quot;method with wrapper argument&quot;</span><span class="token punctuation">)</span><span class="token punctuation">;</span>

<span class="token punctuation">}</span>

<span class="token comment">//calling overloaded method</span>
<span class="token class-name">AutoboxingTest</span> autoTest <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">AutoboxingTest</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
<span class="token keyword">int</span> value <span class="token operator">=</span> <span class="token number">3</span><span class="token punctuation">;</span>
autoTest<span class="token punctuation">.</span><span class="token function">test</span><span class="token punctuation">(</span>value<span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">//no autoboxing</span>
<span class="token class-name">Integer</span> iValue <span class="token operator">=</span> value<span class="token punctuation">;</span>
autoTest<span class="token punctuation">.</span><span class="token function">test</span><span class="token punctuation">(</span>iValue<span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">//no autoboxing</span>

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>在重载的过程中，如果多个同名函数中，一个使用基本数据类型作为参数，一个使用封装数据类型作为参数，那么在使用过程中不会发生重载，传递什么类型的参数，就使用什么类型的函数。</p><h3 id="_3-2-2-对象之间的比较" tabindex="-1"><a class="header-anchor" href="#_3-2-2-对象之间的比较" aria-hidden="true">#</a> 3.2.2 对象之间的比较</h3><p>这是一个比较容易出错的地方，”“可以用于原始值进行比较，也可以用于对象进行比较，当用于对象与对象之间比较时，比较的不是对象代表的值，而是检查两个对象是否是同一对象，这个比较过程中没有自动装箱发生。进行对象值比较不应该使用”“，而应该使用对象对应的 equals 方法。看一个能说明问题的例子。</p><div class="language-java line-numbers-mode" data-ext="java"><pre class="language-java"><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">AutoboxingTest</span> <span class="token punctuation">{</span>

    <span class="token keyword">public</span> <span class="token keyword">static</span> <span class="token keyword">void</span> <span class="token function">main</span><span class="token punctuation">(</span><span class="token class-name">String</span> args<span class="token punctuation">[</span><span class="token punctuation">]</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>

        <span class="token comment">// Example 1: == comparison pure primitive – no autoboxing</span>
        <span class="token keyword">int</span> i1 <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span>
        <span class="token keyword">int</span> i2 <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span>
        <span class="token class-name">System</span><span class="token punctuation">.</span>out<span class="token punctuation">.</span><span class="token function">println</span><span class="token punctuation">(</span><span class="token string">&quot;i1==i2 : &quot;</span> <span class="token operator">+</span> <span class="token punctuation">(</span>i1 <span class="token operator">==</span> i2<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// true</span>

        <span class="token comment">// Example 2: equality operator mixing object and primitive</span>
        <span class="token class-name">Integer</span> num1 <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span> <span class="token comment">// autoboxing</span>
        <span class="token keyword">int</span> num2 <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span>
        <span class="token class-name">System</span><span class="token punctuation">.</span>out<span class="token punctuation">.</span><span class="token function">println</span><span class="token punctuation">(</span><span class="token string">&quot;num1 == num2 : &quot;</span> <span class="token operator">+</span> <span class="token punctuation">(</span>num1 <span class="token operator">==</span> num2<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// true</span>

        <span class="token comment">// Example 3: special case - arises due to autoboxing in Java</span>
        <span class="token class-name">Integer</span> obj1 <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span> <span class="token comment">// autoboxing will call Integer.valueOf()</span>
        <span class="token class-name">Integer</span> obj2 <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span> <span class="token comment">// same call to Integer.valueOf() will return same</span>
                            <span class="token comment">// cached Object</span>

        <span class="token class-name">System</span><span class="token punctuation">.</span>out<span class="token punctuation">.</span><span class="token function">println</span><span class="token punctuation">(</span><span class="token string">&quot;obj1 == obj2 : &quot;</span> <span class="token operator">+</span> <span class="token punctuation">(</span>obj1 <span class="token operator">==</span> obj2<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// true</span>

        <span class="token comment">// Example 4: equality operator - pure object comparison</span>
        <span class="token class-name">Integer</span> one <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Integer</span><span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// no autoboxing</span>
        <span class="token class-name">Integer</span> anotherOne <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Integer</span><span class="token punctuation">(</span><span class="token number">1</span><span class="token punctuation">)</span><span class="token punctuation">;</span>
        <span class="token class-name">System</span><span class="token punctuation">.</span>out<span class="token punctuation">.</span><span class="token function">println</span><span class="token punctuation">(</span><span class="token string">&quot;one == anotherOne : &quot;</span> <span class="token operator">+</span> <span class="token punctuation">(</span>one <span class="token operator">==</span> anotherOne<span class="token punctuation">)</span><span class="token punctuation">)</span><span class="token punctuation">;</span> <span class="token comment">// false</span>

    <span class="token punctuation">}</span>

<span class="token punctuation">}</span>

</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>值得注意的是第三个小例子，这是一种极端情况。obj1 和 obj2 的初始化都发生了自动装箱操作。但是处于节省内存的考虑，JVM 会缓存-128 到 127 的 Integer 对象。因为 obj1 和 obj2 实际上是同一个对象。所以使用”==“比较返回 true。</p><hr><h2 id="_4-使用中需要注意的问题" tabindex="-1"><a class="header-anchor" href="#_4-使用中需要注意的问题" aria-hidden="true">#</a> 4. 使用中需要注意的问题</h2><ol><li>在程序中，如果写了需要不断拆箱和装箱的操作代码，会造成额外的系统开销，增加垃圾回收的压力</li><li>在自动拆箱和自动装箱过程中要注意默认值的问题（在拆箱过程中，如果使用了未初始化的对象，执行 obj.xxxValue 就会报 NullPointerException 异常）</li></ol><hr><h2 id="_5-总结" tabindex="-1"><a class="header-anchor" href="#_5-总结" aria-hidden="true">#</a> 5. 总结</h2><p>Java 中的拆箱和装箱机制便利了程序开发人员，减少了程序开发人员的工作量，使得基本数据类型和封装数据类型之间有一个高效快捷的桥梁。但是凡事都有两面性，在使用过程中一定要注意初始值问题和适用场景问题，切不可以随意任意使用。</p>`,58),o=[i];function l(c,u){return a(),s("div",null,o)}const d=n(p,[["render",l],["__file","ch01-basic.html.vue"]]);export{d as default};
